import React from 'react';

const Notes = (props) => {
  const deleteMe = () => {
    props.deleteItems(props.id);
  };
  return (
    <>
      <h1>{props.head}</h1>
      <div>{props.cont}</div>
      <button onClick={deleteMe}>Delete</button>
    </>
  );
};

export default Notes;
